ToDoItem.propTypes = {
    todoItem: PropTypes.shape({
        id: PropTypes.number, 
        text: PropTypes.string.isRequired, 
    }), 
    todoList: PropTypes.arrayOf(
        PropTypes.shape({ 
            id: PropTypes.number.isRequired, 
            text: PropTypes.string.isRequired, 
        }) 
    ), 
    setTodoList: PropTypes.func.isRequired, 
}; 

export default ToDoItem;
